	"pharelyshau/fragment/Resume/CompanyPopover.fragment.xml":'<core:FragmentDefinition xmlns:core="sap.ui.core" xmlns="sap.m"><Popover contentWidth="20rem" placement="Auto"><customHeader><Toolbar style="Clear"><Title text="{Name}"/><ToolbarSpacer/><Button tooltip="Close" press="onPressCloseCompanyPopover"\n                    icon="{i18n>iClose}"/></Toolbar></customHeader><VBox class="sapUiTinyMargin"><HBox visible="{= !!${Website} }" wrap="Wrap" renderType="Bare"><Label text="{i18n>lWebsite}:" class="sapUiTinyMarginEnd"/><Link text="{Website}" href="{Website}" target="_blank"/></HBox><Text visible="{= !!${Description} }" text="{Description}" class="sapUiTinyMarginTop"/></VBox></Popover></core:FragmentDefinition>',
