	"pharelyshau/fragment/Resume/Experience.fragment.xml":'<core:FragmentDefinition xmlns:core="sap.ui.core" xmlns="sap.m"><VBox><HBox alignItems="{= ${device>/system/phone} || 550 >= ${device>/resize/width} ? \'Start\' : \'Center\' }"><Avatar visible="{= !!${Company/Description} || !!${Company/Website} }"\n                src="{Company/Logo}" press="onPressOpenCompanyPopover"\n                displayShape="Square" fallbackIcon="{i18n>iExperience}"\n                ariaHasPopup="Dialog" class="sapUiTinyMarginEnd"/><Avatar visible="{= !${Company/Description} &amp;&amp; !${Company/Website} }"\n                src="{Company/Logo}" displayShape="Square" decorative="true"\n                fallbackIcon="{i18n>iExperience}" class="sapUiTinyMarginEnd"/><FlexBox direction="{= ${device>/system/phone} || 550 >= ${device>/resize/width} ? \'Column\' : \'Row\' }"\n                alignItems="{= ${device>/system/phone} || 550 >= ${device>/resize/width} ? \'Start\' : \'Center\' }"\n                justifyContent="SpaceBetween" width="100%"><VBox><Title text="{Position}" wrapping="true"/><Text text="{= ${Company/Location} ? ${Company/Name} + \', \' + ${Company/Location} : ${Company/Name}}"/></VBox><VBox visible="{= !${device>/system/phone} &amp;&amp; ${device>/resize/width} > 550 }"\n                    alignItems="End" class="sapUiTinyMarginTop"><Label text="{path: \'StartDate\', formatter: \'.formatter.stringDate\'} – {path: \'EndDate\',  formatter: \'.formatter.stringDate\'}"/><Label text="{parts: [\'StartDate\', \'EndDate\'], formatter: \'.formatter.datesPeriod\'}"/></VBox><Label visible="{= ${device>/system/phone} || 550 >= ${device>/resize/width} }" wrapping="true"\n                    text="{path: \'StartDate\',  formatter: \'.formatter.stringDate\'} – {path: \'EndDate\',  formatter: \'.formatter.stringDate\'} ({parts: [\'StartDate\', \'EndDate\'], formatter: \'.formatter.datesPeriod\'})"/></FlexBox></HBox><Text visible="{= !!${Description} }" text="{Description}" class="sapUiTinyMarginTop"/><FlexBox direction="{= ${Projects}.length > 1 || ${device>/system/phone} || 550 >= ${device>/resize/width} ? \'Column\' : \'Row\' }"\n            renderType="{= ${Projects}.length > 1 || ${device>/system/phone} || 550 >= ${device>/resize/width} ? \'Div\' : \'Bare\' }"\n            visible="{= !!${Projects} &amp;&amp; ${Projects}.length > 0}" wrap="Wrap"  class="sapUiTinyMarginTop"><Label text="{= ${Projects}.length > 1 ? ${i18n>lProjects} : ${i18n>lProject} }:" class="sapUiTinyMarginEnd"/><VBox visible="{= ${Projects}.length > 1 }" items="{path: \'Projects\', templateShareable: false}"><Text text="• &#160;{}"/></VBox><Text visible="{= ${Projects}.length === 1 }" text="{Projects/0}"/></FlexBox><Label text="{i18n>lResponsobilities}:" class="sapUiTinyMarginTop"/><VBox items="{path: \'Responsobilities\', templateShareable: false}"><Text text="• &#160;{}"/></VBox><VBox visible="{= ${Achievements}.length > 0}"><Label text="{i18n>lAchievements}:" class="sapUiTinyMarginTop"/><VBox items="{path: \'Achievements\', templateShareable: false}"><Text text="• &#160;{}"/></VBox></VBox><Label text="{i18n>lSkills}:" class="sapUiTinyMarginTop sapUiTinyMarginEnd"/><Text text="{Skills}"/><Toolbar visible="{= ${} !== ${/Experience}.at(-1) }"\n            height="0.8rem" class="phToolbarSeparator sapUiTinyMarginBottom"/></VBox></core:FragmentDefinition>',
	"pharelyshau/fragment/Resume/RelocationPopover.fragment.xml":'<core:FragmentDefinition xmlns:core="sap.ui.core" xmlns="sap.m"\n    core:require="{ formatMessage: \'sap/base/strings/formatMessage\' }"><Popover contentWidth="20rem" placement="Auto"><customHeader><Toolbar style="Clear"><Title text="{i18n>ttlRelocationTo} {Country}"/><ToolbarSpacer/><Button tooltip="{i18n>btnClose}" press="onPressCloseRelocationPopover"\n                    icon="{i18n>iClose}"/></Toolbar></customHeader><VBox class="sapUiTinyMargin"><Text text="{Description}"/><FormattedText class="sapUiTinyMarginTop" htmlText="{i18n>tForMoreInfo}\n                {parts: [\'i18n>linkWithText\', \'Link\', \'LinkText\'], formatter: \'formatMessage\'}"/></VBox></Popover></core:FragmentDefinition>',
